import React from 'react';
import {Link, useNavigate} from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();


    return (
        <div>
            <h1>Welcome to the Energy Management System</h1>
            <Link to="/device-list">
                <button>View All Devices</button>
            </Link>

            <button className="btn btn-primary" onClick={() => navigate('/insert-device')}>
                Insert Device
            </button>
            <button className="btn btn-secondary" onClick={() => navigate('/update-device')}>
                Update Device
            </button>
            <button className="btn btn-danger" onClick={() => navigate('/delete-device')}>
                Delete Device
            </button>
        </div>
    );
};

export default Home;
